webpackJsonp([0xf8a5e54e3d09],{384:function(e,t){e.exports={data:{markdownRemark:{html:'<p>As the conference date is getting closer and closer, it is about time that we\nraise the curtain and have a look at the talk proposals that we were able to\naccepted so far.</p>\n<p>At this point, we would like to shout out a big thank you to all the great\npeople who have submitted proposals, especially those, who took the time to\nsubmit but got rejected. We do hope that you visit the conference anyways\nand submit your proposals again, next year!</p>\n<p>We are still reviewing a lot of talk proposals that have been submitted\nlast-minute, so we will add around eight to ten more talks to the list. Once we\nhave the final list of talks, we will update the\n<a href="https://pycon.sg/schedule/">Conference Schedule Page</a> and let you know the\nexact dates and times and rooms for each talk.</p>',frontmatter:{date:"April 30, 2018",path:"/news/talks",title:"Preliminary List of Talks"}}},pathContext:{}}}});
